import './App.css';
import Link from './Components/Link';
import ApplicantLogin from './Pages/ApplicantLogin';
import ConfirmExam from './Pages/ConfirmExam';
import Route from './Components/Route';
import QuestionsExam from './Pages/QuestionsExam';
import SubmitExam from './Pages/SubmitExam';
import { useDispatch, useSelector } from 'react-redux';
import { loadPath, changePath, LOGIN_PAGE_PATH, CONFIRM_PAGE_PATH, QUESTIONS_PAGE_PATH, SUBMIT_PAGE_PATH } from './store';
import { useEffect } from 'react';

function App() {

  const user = useSelector((state) => state.userData);

  const dispatch = useDispatch();
  useEffect(() =>
  {
    Start();
  }, []);

  const Start = ()=>
  {
    console.log(user);
    if(user != {})
    {
      dispatch(loadPath(LOGIN_PAGE_PATH));
    }else
    {
      dispatch(loadPath(CONFIRM_PAGE_PATH));
    }

    const handler = (event) =>
    {
      event.preventDefault();
      dispatch(changePath(window.location.pathname));
    }
    window.addEventListener('popstate', handler);
    return () =>
    {
      window.removeEventListener('popstate', handler)
    }
  }

  return (
    <div>
      <header className="App-header centereForm">
        <h1>Interview Hub</h1>
      </header>

      <div>
        <Route path={LOGIN_PAGE_PATH}>
          <ApplicantLogin/></Route>
        <Route path={CONFIRM_PAGE_PATH}>
          <ConfirmExam/></Route>
        <Route path={QUESTIONS_PAGE_PATH}>
          <QuestionsExam/></Route>
        <Route path={SUBMIT_PAGE_PATH}>
          <SubmitExam/>
        </Route>
      </div>
    </div> 
  );
}

export default App;
